import React from 'react';
//Import Icons
import react_logo from '../img/react.svg'; 
import js_logo from '../img/javascript.svg'; 
import java_logo from '../img/java.svg'; 
import sass_logo from '../img/sass.svg'; 
import coding from '../img/coding.jpg';
//Import Styled Components
import styled from 'styled-components';
import {
    StyledAbout,
    StyledDescription,
    StyledHide,
    StyledImage,
    StyledIcon,
} from '../styles.js';

const ServicesSection = () => {
    return(
        <StyledServices>
            <StyledDescription>
                <h2><span>Frameworks</span> and <span>Languages</span></h2>
                <div className="cards">
                    <div className="card">
                        <StyledIcon>
                            <img src={react_logo} alt="React logo" />
                            <h3>React</h3>
                            <p>Lorem ipsum dolor sit amet</p>
                        </StyledIcon>
                    </div>
                    <div className="card">
                        <StyledIcon>
                            <img src={js_logo} alt="JavaScript logo" />
                            <h3>JavaScript</h3>
                            <p>Lorem ipsum dolor sit amet</p>
                        </StyledIcon>
                    </div>
                    <div className="card">
                        <StyledIcon>
                            <img src={java_logo} alt="Java logo" />
                            <h3>Java</h3>
                            <p>Lorem ipsum dolor sit amet</p>
                        </StyledIcon>
                    </div>
                    <div className="card">
                        <StyledIcon>
                            <img src={sass_logo} alt="Sass logo" />
                            <h3>Sass</h3>
                            <p>Lorem ipsum dolor sit amet</p>
                        </StyledIcon>
                    </div>
                </div>
            </StyledDescription>
            <StyledImage>
                <img src={coding} alt="Beep Boop" />
            </StyledImage>
        </StyledServices>
    );
};

